import { RemoveTopicService, RemoveTopicUseCase } from '../usecase/RemoveTopic'

class RemoveTopic implements RemoveTopicUseCase {
  private readonly service: RemoveTopicService

  constructor(service: RemoveTopicService) {
    this.service = service
  }

  removeTopic(token: string, topicId: string): Promise<boolean> {
    return this.service.removeTopic(token, topicId)
  }
}

export { RemoveTopic }
